import React from "react";
import { Input } from "antd";
const CusomInput = ({ value, onChange, price, onPrice }) => {
  return (
    <Input
      placeholder="name"
      value={value || price}
      onChange={onChange || onPrice}
      allowClear
    />
  );
};

export default CusomInput;
